GetFeatureAssociationMatrix <- function(project, associationType = "association", metric = "mutualInfo", featurelistId = NULL, ...) {
  project <- ValidateProject(project)
  routeString <- UrlJoin("projects", project, "featureAssociationMatrix")
  params <- list(metric = metric, type = associationType)
  # start of generated addition
  params <- get0("params", mode = "list", ifnotfound = list())
  params$featurelistId <- featurelistId
  # end of generated addition
  return(DataRobotGET(routeString, query = params))
}

