#' InitializeAnomalyAssessment
#'
#' Calculate the anomaly assessment insight.
#'
#' Initialize the anomaly assessment insight and calculate Shapley explanations for the most anomalous points in the subset. The insight is available for anomaly detection models in time series unsupervised projects which also support calculation of Shapley values.
#'
#' @seealso The method ProjectsModelsAnomalyAssessmentInitializationCreate in [datarobot.apicore::InsightsApi], which this function wraps.
#' @family Insights
#' @export
InitializeAnomalyAssessment <- function(projectId, modelId, backtest, source, seriesId = NULL, ...) {
  body <- list(backtest = backtest, source = source)
  if (!is.null(seriesId)) {
    body$seriesId <- seriesId
  }
  routeString <- UrlJoin(
    "projects", projectId, "models", modelId,
    "anomalyAssessmentInitialization"
  )
  # start of generated addition
  # end of generated addition
  postResponse <- DataRobotPOST(routeString, body = body, addUrl = TRUE, returnRawResponse = TRUE)
  response <- WaitForAsyncReturn(GetRedirectFromResponse(postResponse),
    addUrl = FALSE
  )
  record <- as.dataRobotAnomalyAssessmentRecord(response["data"][[1]])
  return(record)
}

